import React, { Component } from "react";
import { useState, useEffect } from "react";
import Loader from "./Loader";
import Track from "./Track";
import { TrackType } from "../types/Types";
import "../components/TrackList.css";
import axios from "axios";

function TrackList() {
  const [tracks, setTracks] = useState([]);

  const newTrack = {
    title: "Test",
    artist: "Test",
    genre: "Test",
    bpm: 100,
  }

  useEffect(() => {
    fetch("http://localhost:8080/tracks")
      .then((response) => response.json())
      .then((data) => setTracks(data))
      .catch((err) => console.log(err));
  }, []);

  function updateTracks() {
    fetch("http://localhost:8080/tracks")
    .then((response) => response.json())
    .then((data) => setTracks(data))
    .catch((err) => console.log(err));
  }

  function RemoveTitle(id: number) {

  }

  async function AddTitle() {
    const response = await axios.post("http://localhost:8080/tracks", newTrack)
    updateTracks();
    return response.data;
  }

  return (
    <div>
      <h2>Favorite Tracks</h2>
      <table className="center">
        <thead>
          <tr>
            <th>ID</th>
            <th>Title</th>
            <th>Artist</th>
            <th>Genre</th>
            <th>BPM</th>
            <th>Remove Track</th>
          </tr>
        </thead>
        <tbody>
          {tracks.map((track: TrackType) => (
            <Track data={track} onDelete={RemoveTitle}/>
          ))}
        </tbody>
      </table>
      <button className="buttonAdd" onClick={() => AddTitle()}>Add Track</button>
    </div>
  );
}

export default TrackList;
